import { Component } from '@angular/core';
import { CommonModule } from '@angular/common';
import { DataService } from '../../services/data.service';
import { Router } from '@angular/router';

@Component({
    selector: 'app-interview-results',
    standalone: true,
    imports: [CommonModule],
    template: `
        <div class="results-container" *ngIf="dataService.evaluationResults">
            <h2>Interview Results</h2>
            <div class="evaluation-summary">
                <div class="section">
                    <h3>Strengths</h3>
                    <ul>
                        <li *ngFor="let strength of dataService.evaluationResults.strengths">
                            {{ strength }}
                        </li>
                    </ul>
                </div>
                
                <div class="section">
                    <h3>Areas for Improvement</h3>
                    <ul>
                        <li *ngFor="let area of dataService.evaluationResults.areasForImprovement">
                            {{ area }}
                        </li>
                    </ul>
                </div>
                
                <div class="section">
                    <h3>Detailed Feedback</h3>
                    <div class="feedback-item">
                        <strong>Technical Skills:</strong> 
                        {{ dataService.evaluationResults.detailedFeedback['Technical Skills'] }}
                    </div>
                    <div class="feedback-item">
                        <strong>Communication Skills:</strong>
                        {{ dataService.evaluationResults.detailedFeedback['Communication Skills'] }}
                    </div>
                    <div class="feedback-item">
                        <strong>Problem-Solving Ability:</strong>
                        {{ dataService.evaluationResults.detailedFeedback['Problem-Solving Ability'] }}
                    </div>
                    <div class="feedback-item">
                        <strong>Team Collaboration:</strong>
                        {{ dataService.evaluationResults.detailedFeedback['Team Collaboration'] }}
                    </div>
                </div>
                
                <div class="section">
                    <h3>Final Decision</h3>
                    <div class="decision" [class.accepted]="dataService.evaluationResults.finalDecision.decision === 'Accepted'">
                        {{ dataService.evaluationResults.finalDecision.decision }}
                    </div>
                    <div class="ratings">
                        <div class="rating-item">
                            <strong>Technical Skills:</strong> 
                            {{ dataService.evaluationResults.finalDecision.ratings['Technical Skills'] }}/5
                        </div>
                        <div class="rating-item">
                            <strong>Communication:</strong>
                            {{ dataService.evaluationResults.finalDecision.ratings['Communication Skills'] }}/5
                        </div>
                        <div class="rating-item">
                            <strong>Problem-Solving:</strong>
                            {{ dataService.evaluationResults.finalDecision.ratings['Problem-Solving'] }}/5
                        </div>
                        <div class="rating-item">
                            <strong>Experience:</strong>
                            {{ dataService.evaluationResults.finalDecision.ratings['Experience Level'] }}/5
                        </div>
                    </div>
                </div>
            </div>
        </div>
    `,
    styles: [`
        .results-container {
            max-width: 800px;
            margin: 40px auto;
            padding: 20px;
            background-color: #151e33;
            border-radius: 12px;
            color: white;
        }

        h2 {
            text-align: center;
            margin-bottom: 30px;
            color: #2563eb;
        }

        .section {
            background-color: #1e2c4a;
            padding: 20px;
            margin-bottom: 20px;
            border-radius: 8px;
        }

        h3 {
            color: #2563eb;
            margin-bottom: 15px;
        }

        ul {
            list-style-type: none;
            padding: 0;
        }

        li {
            margin-bottom: 10px;
            padding-left: 20px;
            position: relative;
        }

        li:before {
            content: "•";
            color: #2563eb;
            position: absolute;
            left: 0;
        }

        .feedback-item {
            margin-bottom: 10px;
        }

        .decision {
            font-size: 24px;
            font-weight: bold;
            text-align: center;
            margin: 20px 0;
            color: #ef4444;
        }

        .decision.accepted {
            color: #10b981;
        }

        .ratings {
            display: grid;
            grid-template-columns: repeat(auto-fit, minmax(200px, 1fr));
            gap: 15px;
        }

        .rating-item {
            background-color: #151e33;
            padding: 10px;
            border-radius: 4px;
            text-align: center;
        }
    `]
})
export class InterviewResultsComponent {
    constructor(public dataService: DataService, private router: Router) {
        // Redirect to interview page if no results are available
        if (!this.dataService.evaluationResults) {
            this.router.navigate(['/ai-interview']);
        }
    }
} 
}
